import React from 'react';
import NuestrosProductos from './NuestrosProductos';
import NuestrasOfertas from './NuestrasOfertas';

function ContentRowBotton(){
    return (
        <React.Fragment>
        {/*<!-- Content Row -->*/}
        <div className="row">
            {/*<!-- Last Product in DB -->*/}
            <NuestrosProductos />    
            <NuestrasOfertas />
        </div>
        </React.Fragment>
    )
}
export default ContentRowBotton;
